import React from 'react'

const BirthdayToday = ({people}) => {
    return (
        <>
          {people.map((person)=>{
              const {id,name,birthday}=person;
              return(
                <div className="card" >
                <img className="card-img-top" src="" alt={name}/>
                <div className="card-body">
                  <h5 className="card-title">{name}</h5>
                  <p className="card-text">{birthday}}</p>
                  <a href="#" className="btn btn-primary">Remove</a>
                </div>
              </div>
              )
          })}  
        </>
    )
}

export default BirthdayToday
